import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import {
  Footer,
  Blog,
  Possibility,
  Features,
  WhatGPT3,
  Header,
} from './containers';
import { CTA, Brand, Navbar } from './components';

import './App.css';

